// SPDX-License-Identifier: MIT
pragma solidity ^0.8.18;

import "@openzeppelin/contracts/token/ERC20/ERC20.sol";
import "@openzeppelin/contracts/token/ERC20/extensions/ERC20Burnable.sol";
import "@openzeppelin/contracts/security/ReentrancyGuard.sol";
import "@openzeppelin/contracts/security/Pausable.sol";
import "@openzeppelin/contracts/access/Ownable.sol";

contract TimeVillageToken is ERC20, ERC20Burnable, Pausable, Ownable,ReentrancyGuard {

    struct userRecord{
        uint Type;
        uint amount;
    }

    mapping (address => userRecord) public Record;


    constructor() ERC20("Time Village Token", "TVT") {
        _mint(msg.sender, 2500000000 * 10 ** decimals());
    }


    function getEthFromUser(address from,uint256 Type , uint256 amount) public payable nonReentrant  {
        if(Type == 1){
            Record[from] = userRecord(Type,amount);

        }
    }

    // function setRecord(uint amount) public {

    // }

    function pause() public onlyOwner {
        _pause();
    }

    function unpause() public onlyOwner {
        _unpause();
    }

    function _beforeTokenTransfer(address from, address to, uint256 amount)
        internal
        whenNotPaused
        override
    {
        super._beforeTokenTransfer(from, to, amount);
    }
}

